import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { JpgFilesComponent } from './Components/jpg-files/jpg-files.component';
import { NoJpgFilesComponent } from './Components/no-jpg-files/no-jpg-files.component';
import { SomeJpgFilesComponent } from './Components/some-jpg-files/some-jpg-files.component';
import { HomeComponent } from './Components/home/home.component';
import { ListBarComponent } from './Components/list-bar/list-bar.component';

const routes: Routes = [

   {path:"home",component:HomeComponent},

   {path:"listBar",component:ListBarComponent},

   {path:"NoJpgFiles",component:NoJpgFilesComponent},

   {path:"JpgFiles",component:JpgFilesComponent},

  //  {path:"SomeJpgFiles",component:SomeJpgFilesComponent},

  ];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export const lawsModuleRoutes: Routes = [
{
   path: 'home:path',
   component: HomeComponent
}];
export class AppRoutingModule { }
